import React, { Component } from 'react';


class Photo extends Component {
    render () {
        let images = [{
            original: {Beaufort},
            thumbnail: {Beaufort},
        }, 
        {
            original: '../images/photography/Cake.jpg',
            thumbnail: '../images/photography/Cake.jpg',
        },
        {
            original: '../images/photography/Downtown-Bridge-yo.jpg',
            thumbnail: '../images/photography/Downtown-Bridge-yo.jpg',
        },
        {
            original: '../images/photography/expanse.jpg',
            thumbnail: '../images/photography/expanse.jpg',
        },
        {
            original: '../images/photography/Fripp.jpg',
            thumbnail: '../images/photography/Fripp.jpg',
        },
        {
            original: '../images/photography/houses.jpg',
            thumbnail: '../images/photography/houses.jpg',
        },
        {
            original: '../images/photography/IMG_0140-1.jpg',
            thumbnail: '../images/photography/IMG_0140-1.jpg',
        },
        {
            original: '../images/photography/IMG_6175.JPG',
            thumbnail: '../images/photography/IMG_6175.JPG',
        },
        {
            original: '../images/photography/nature.jpg',
            thumbnail: '../images/photography/nature.jpg',
        },
        {
            original: '../images/photography/newpoint.jpg',
            thumbnail: '../images/photography/newpoint.jpg',
        },
        {
            original: '../images/photography/sunnyday.jpg',
            thumbnail: '../images/photography/sunnyday.jpg',
        },
    ]
    return (
        <ImageGallery items={images} />
    )
    }
}

export default Photo;
